&#60;p&#62;la boite mail outlook à distance est différente de la boite mail local\xa0&#60;br&#62;\xa0&#60;br&#62;lpp n'apparait pas sur la boite mail a distance \xa0 mais apparait sur le coté \xa0\xa0&#60;/p&#62;", '&#60;p&#62;en gros, Il y a deux problèmes avec les e-mails : le premier envoyé à 07:54 est dans les "Send Items" mais reste dans la "Outbox", malgré un ticket ouvert par ma collègue Guyveline. Un rappel depuis le 17.08.2023 n'a pas été effectué. Le second e-mail à 07:31 n'a jamais été envoyé. D'autres e-mails rédigés sont partis de la "Outbox&#60;/p&#62;', "&#60;p&#62;- call avec l'utilisatrice\xa0&#60;/p&#62;", '&#60;p&#62;appel avec l'utilisatrice + recherche de solutions :\xa0&#60;/p&#62;
&#60;p&#62;- le 1er incident est résolu, mais les mails ne s'envoie pas\xa0&#60;/p&#62;
&#60;p&#62;- les mails restent dans outboox&#60;/p&#62;
&#60;p&#62;- j'ai convenue avec l'utilisatrice de chercher la solution de mon côté et de la contacter par la suite\xa0&#60;/p&#62;
&#60;p&#62;- j'ai remarqué que la boite est pleine à 94%\xa0 à vérifier si cela peux poser problème\xa0&#60;/p&#62;
&#60;p&#62;&#60;a href="https://learn.microsoft.com/fr-fr/outlook/troubleshoot/synchronization/email-stays-in-outbox-until-manually-send-or-receive"&#62;Les e-mails restent dans la boîte d'envoi jusqu'à ce qu'ils soient envoyés ou reçus manuellement - Outlook | Microsoft Learn&#60;/a&#62;\xa0&#60;/p&#62;
&#60;p&#62;&#60;a href="https://learn.microsoft.com/fr-fr/outlook/troubleshoot/email-management/email-remains-in-the-outbox-when-you-use-the-deleg"&#62;Email reste dans Outbox si vous utilisez DelegateSentItemsStyle - Outlook | Microsoft Learn&#60;/a&#62;&#60;/p&#62;
&#60;p&#62;&#60;a href="https://learn.microsoft.com/fr-fr/outlook/troubleshoot/email-management/emails-remain-in-outbox-deferred-delivery-rule"&#62;Les e-mails restent dans la boîte de réception pendant au moins une minute - Outlook | Microsoft Learn&#60;/a&#62;&#60;/p&#62;', "&#60;p&#62;Appel reçu: Mme Kljunic à encore des soucis avec son outbox les e-mails ne partent pas. Elle dit que ce n'est pas grave s'ils ne partent pas tout de suite et\xa0demande à être rappeler par M. Freitas.&#60;br&#62;&#60;br&#62;Pour info elle sera en meeting de 15h00 à 16h00.&#60;/p&#62;", "&#60;p&#62;-\xa0 call avec l'utilisatrice\xa0&#60;/p&#62;
&#60;p&#62;&#60;br&#62;- méthode de résolution de l'incident\xa0&#60;/p&#62;
