&#60;p&#62;2 - choisir application M365\xa0 et cliquer sur modify ensuite effectuer quick repair\xa0&#60;/p&#62;
&#60;p&#62;3- mail and calendar\xa0 \xa0quick repair\xa0&#60;/p&#62;
