&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;Il faudra la rappeler vers 13h30-14h00 aujourd'hui pour voir en détails ce qu'il se passe et tanter de résoudre son cas définitivement.&#60;/p&#62;
