&#60;p&#62;merci de regarder ce qu'il en est et reprendre contact avec Anissa&#60;/p&#62;', "&lt;p&gt;Appel reçu.&lt;br /&gt;&lt;br /&gt;Mme Taguelmint me confirme que l'option dans Teams est bien foncitonnel et cela ne sonne plus dans le casque lorsqu'elle est en appel.&lt;/p&gt;&lt;p&gt;Elle demande à ce que cette option soit activé à toute son équipe Payroll.&lt;/p&gt;", "&lt;p&gt;Appel cliente: NOK.&lt;/p&gt;&lt;p&gt;Sa collègue me dit qu'elle n'est pas là les lundis ainsi que tout les matins.&lt;/p&gt;&lt;p&gt;Rappel prévu demain après-midi.&lt;/p&gt;&lt;p&gt;Je laisse un follow up.&lt;/p&gt;", '&lt;p&gt;appel d&#039;Anissa&lt;/p&gt;&lt;p&gt;chang&eacute; parametre dans son teams&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;/glpi/front/document.send.php?docid=71279&amp;tickets_id=198591&quot; target=&quot;_blank&quot; &gt;&lt;img alt=&quot;27ef38ca-f37490bd-6464c64932f386.03291235&quot; width=&quot;177.77091377091375&quot; src=&quot;/glpi/front/document.send.php?docid=71279&amp;tickets_id=198591&quot; /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;test&eacute;, le tout semble ok&lt;/p&gt;&lt;p&gt;elle va quand mm tester plus en profondeur &agrave; recontacter lundi pour etre sur que ok&lt;/p&gt;', '&lt;p&gt;besoin de changer la config chez la cliente&lt;/p&gt;&lt;p&gt;tenté de recontacter pas de réponse&lt;/p&gt;', '&lt;p&gt;recontacté Anissa, problème toujours présent&lt;/p&gt;&lt;p&gt;à réinvestiguer&lt;/p&gt;', '&lt;p&gt;&lt;a href=&quot;/glpi/front/document.send.php?docid=71161&amp;tickets_id=198591&quot; target=&quot;_blank&quot; &gt;&lt;img alt=&quot;27ef38ca-f37490bd-6461e44193dc83.69816310&quot; width=&quot;107.34699453551914&quot; src=&quot;/glpi/front/document.send.php?docid=71161&amp;tickets_id=198591&quot; /&gt;&lt;/a&gt;&lt;/p&gt;', "&lt;p&gt;l'option n'était pas là après un disconnect de teams etc\xa0&lt;/p&gt;", '&lt;p&gt;https://learn.microsoft.com/en-US/microsoftteams/teams-calling-policy#busy-on-busy-is-available-when-in-a-call&lt;/p&gt;&lt;p&gt;\xa0&lt;/p&gt;&lt;p&gt;Create on team admin center new calling policy "Busy-on-busy - User controlled"&lt;/p&gt;&lt;p&gt;Assigned directly to Anissa.&lt;/p&gt;&lt;p&gt;Rules need time to be turn on and fully functionnal.&lt;/p&gt;&lt;p&gt;Todotomorrow :&lt;/p&gt;&lt;p&gt;https://microsoft365pro.co.uk/2022/12/18/teams-real-simple-with-pictures-user-controlled-busy-on-busy/&lt;/p&gt;&lt;p&gt;Teamviewer with Anissa -&gt; Teams -&gt; Settings -&gt; Calls -&gt; When you're in a call and receive another call -&gt; Select one of the proposal&lt;/p&gt;&lt;p&gt;&lt;img src="https://microsoft365pro.files.wordpress.com/2022/12/image-58.png?w=1024" alt="https://microsoft365pro.files.wordpress.com/2022/12/image-58.png?w=1024" /&gt;&lt;/p&gt;', '&lt;p&gt;Auto reject call dans les param&egrave;tres du Jabra:&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=70056&amp;tickets_id=198591&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;&lt;img src=&quot;https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=70056&amp;tickets_id=198591&quot; alt=&quot;27ef38ca-f37490bd-643eaad3646471.12404522&quot; width=&quot;190.11889035667107&quot; /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&nbsp;&lt;/p&gt;&lt;p&gt;https://techcommunity.microsoft.com/t5/microsoft-teams/reject-calls-when-status-is-busy-or-not-available/m-p/1230223&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;/glpi/front/document.send.php?docid=70058&amp;tickets_id=198591&quot; target=&quot;_blank&quot; &gt;&lt;img alt=&quot;27ef38ca-f37490bd-643eacc2062992.46492353&quot; width=&quot;551&quot; src=&quot;/glpi/front/document.send.php?docid=70058&amp;tickets_id=198591&quot; /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&nbsp;&lt;/p&gt;&lt;p&gt;https://www.lync.se/2020/02/teams-calling-you-want-to-be-busy/&lt;/p&gt;']

